import React from "react";
import { Helmet } from "react-helmet";

const Notifications = () => {
  return (
    <div>
      <Helmet>
        <title>LinkClick Notifications</title>
      </Helmet>
      <h2>Notifications & Reminders</h2>
      <p>Stay updated with important alerts and reminders.</p>
    </div>
  );
};

export default Notifications;
